experiment
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(future (sh "kate" (str (<!? (-bget store (:train.log blobs) :file)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;core$future_call$reify__6320@38ae3404: :pending&gt;</span>","value":"#<core$future_call$reify__6320@38ae3404: :pending>"}
