(gg4clj/view 
  [[:<- :d (gg4clj/data-frame {:x (into (vec (range (count states))) (range (count states)))     
                               :y (vec (concat (map (a/sample-freqs samples) states) (map (partial get-in joint-tensor) states)))
                               :z (into (vec (repeat (count states) "samples")) (repeat (count states) "trained"))})]
  (gg4clj/r+ [:ggplot :d [:aes {:x :x :y :y :fill :z}]]
                        [:geom_bar {:stat "identity" :position (keyword "position_dodge()")}])])
	
