;; @@
(let [avg (map i/mean (mat/transpose (map #(map % (f/state-space 2)) trad-theos)))
      sd (map i/sd (mat/transpose (map #(map % (f/state-space 2)) trad-theos)))]
(gg4clj/view
  [[:<- :d (gg4clj/data-frame 
             {:x (map (comp str vec) 
                      (apply concat (repeat 1 states)))             
              :y (vec avg)
              :sdup (mat/add avg sd)
              :sddown (mat/sub avg sd)
              :z (vec (concat (repeat (count states) "theo"))
                      	      )})]
  (gg4clj/r+ [:ggplot :d [:aes {:x :x :y :y :fill :z}]]
             [:geom_bar {:stat "identity"      
                         :position 
                         (keyword "position_dodge()")}]
             [:geom_errorbar [:aes {:ymin :sddown, :ymax :sdup}], 
                              {:width 0.2
                               :position (keyword "position_dodge(.9)")}])])

)
